import React from "react";
import styles from "./TableCus.module.css";
import mockDataCus from "./mockCus.json";

const TableCus = () => {
  return (
    <table className={styles.CusTable}>
      <thead>
        <tr>
          <th>ID</th>
          <th>이름</th>
          <th>이메일</th>
          <th>전화번호</th>
        </tr>
      </thead>
      <tbody>
        {mockDataCus.filter(searchFilter).map((customer) => (
          <tr key={customer.id}>
            <td>{customer.id}</td>
            <td>{customer.name}</td>
            <td>{customer.email}</td>
            <td>{customer.phone}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default TableCus;
